function HtmlCss() {
  const style1 = {
    backgroundColor: "red",
    border: "1px solid black",
    height: "8vh",
  };
  const style2 = {
    backgroundColor: "red",
    width: "1vh",
    border: "1px solid black",
    height: "100%",
  };
  return (
    <div>
      <div style={style1}></div>
      <div style={style2}></div>
    </div>
  );
}

export default HtmlCss;
